#include <cstdio>
#include <algorithm>
using namespace std;

const int MAXN = 100;

int lis[MAXN], n, bes, sum[MAXN];

void search(int p, int dif, int s) {
  if(dif == 0 && s > bes) {
    bes = s;
//printf("%d\n", sum[n-1] - bes);
  }
  if(p >= 0) {
    if(abs(dif) > sum[p]) return;
    if(s + sum[p] <= bes) return;
    search(p - 1, dif + lis[p], s + lis[p]); 
    search(p - 1, dif - lis[p], s + lis[p]); 
    search(p - 1, dif, s);
  }
}

int Split(int N, int *M){
  n = N;
  for(int i = 0; i < n; ++i) {
    lis[i] = M[i];
    sum[i] = ((i == 0) ? 0 : sum[i-1]) + lis[i];
  }
  bes = 0;
  search(n-1, 0, 0);
//printf("%d\n", sum[n-1] - bes);
  return sum[n-1] - bes;
}

main() {
    int N;
    int M[33];
    int i;
    while(1) {
        scanf("%d", &N);
        if(!N) break;
        for(i = 0; i < N; i++) scanf("%d", M+i);
        i = Split(N,M);
        printf("%d\n", i);
    }
}

#include <cstdio>
#include <cstring>
#include <algorithm>
using namespace std;

const int RNG = 100;
const int ZERO = 50;

int dir[8][2] = {{-2, -1}, {-2, 1}, {-1, -2}, {-1, 2},
{1, -2}, {1, 2}, {2, -1}, {2, 1}};

int d[RNG][RNG];
int q[RNG*RNG][2], tail;

void add(int r1, int c1, int d1) {
  if(d[r1][c1] == -1) {
    d[r1][c1] = d1;
    q[tail][0] = r1; 
    q[tail++][1] = c1;
  }
}

int moo(int x, int y) {
  x = abs(x);
  y = abs(y);
  if(x < y) swap(x, y);
  if(x < 20 && y < 20) return d[ZERO + x][ZERO + y];
  if(y == 0) {
    int k = max(0, (x - 10) / 4);
    return k * 2 + moo(x - k * 4, 0);
  }
  else if(x < y + 3) {
    int k = max(0, (y - 10) / 3);
    return k * 2 + moo(x - k * 3, y - k * 3);
  }
  else {
    int k = min(min(x - y, y), max(x / 2, y) - 5);
    return k + moo(x - k * 2, y - k);
  } 
}

char line[1234];
int main() {
  for(int i = 0; i < RNG; ++i)
    for(int j = 0; j < RNG; ++j)
      d[i][j] = -1;
  tail = 0;
  add(ZERO, ZERO, 0);
  for(int i = 0; i < tail; ++i)
    for(int j = 0; j < 8; ++j)
      add(q[i][0] + dir[j][0], q[i][1] + dir[j][1], d[q[i][0]][q[i][1]] + 1); 
  gets(line);
  while(strcmp(line, "END") != 0) {
    int x, y;
    sscanf(line, "%d%d", &x, &y);
    printf("%d\n", moo(x, y));
    gets(line);
  }
  return 0;
}

#include <stdio.h>
#include <math.h>

int n;
double x[1000], y[1000], r[1000];
int top[1000];

int possible = 1;
double ne = 1000, nw = 1000;

main(){
   int i,j,k;
   scanf("%d",&n);
   for (i=0;i<n;i++) scanf("%lf%lf%lf",&x[i],&y[i],&r[i]);
   for (i=0;i<n;i++) if (y[i]+r[i] > 1000) visit(i);
   /*
   if (possible) printf(
     "Bill enters at (0.00, %0.2lf) and leaves at (1000.00, %0.2lf).\n",nw,ne);
   else printf("Bill will be bitten.\n");
   */
   if (possible) printf(
     "0.00 %0.2lf 1000.00 %0.2lf\n",nw,ne);
   else printf("IMPOSSIBLE\n");
}

visit(int i){
   int j,k;
   double yy;
   if (top[i]++) return;

   for (j=0;j<n;j++) {
      if (hypot(x[j]-x[i],y[j]-y[i]) < r[i]+r[j]) visit(j);
   }
   if (y[i]-r[i] < 0) possible = 0;
   if (x[i]-r[i] < 0) {
      yy = y[i] - sqrt(r[i]*r[i] - x[i]*x[i]);
      if (yy < nw) nw = yy;
   }
   if (x[i]+r[i] > 1000) {
      yy = y[i] - sqrt(r[i]*r[i] - (1000-x[i])*(1000-x[i]));
      if (yy < ne) ne = yy;
   }
}
